let info = {"rowCount":10000,"colCount":10000,"vehiclesCount":400,"ridesCount":10000,"bonusCount":2,"stepsCount":50000};

let cars = [];
for (let i = 0; i < info.vehiclesCount; i++) {
    cars.push({id: i, x: 0, y: 0, tick: 0, doneRoutes: []});
}

// Set ids for routes
data.forEach((data, index) => {
    data.index = index;
});


function compare(fieldName) {
    return function (a, b) {
        if (a[fieldName] < b[fieldName])
            return -1;
        if (a[fieldName] > b[fieldName])
            return 1;
        return 0;
    }
}

data = data.sort(compare("s"));

for (let tick = 1; tick <= info.stepsCount; tick++) {

    let freeCars = getFreeCard(cars, tick);
    freeCars.forEach((car, index) => {
        let validRoutes = data.filter(route => shouldDoRoute(car, route, tick));
        validRoutes.map(route => {
            route.ttsp = ticksToStartPosition(car, route)
        });
        validRoutes = validRoutes.sort(compare("ttsp"));

        let firstValidRoute = validRoutes[0];

        if (firstValidRoute) {
            applyRouteToCar(firstValidRoute, car, tick);
        }
    });

  //  console.log(`tick: ${tick}, freeCars: ${freeCars.length}`)
}

let solutionText = cars.map(car => car.doneRoutes.length + ' ' + car.doneRoutes.join(' ')).join('\n');
require("fs").writeFile("solution.txt", solutionText, 'utf8');

function applyRouteToCar(route, car, tick) {
    let ticksToStartPosition_ = ticksToStartPosition(car, route);
    let isNeedWait = ticksToStartPosition_ + tick < route.s;
    let ticksToWait = !isNeedWait ? 0 : route.s - (ticksToStartPosition_ + tick);
    let ticksForDoingRoute_ = ticksForDoingRoute(route);
    car.tick = tick + ticksToStartPosition_ + ticksToWait + ticksForDoingRoute_;
    car.x = route.x;
    car.y = route.y;
    car.doneRoutes.push(route.index);
    data = remove(data, route)
}


function getFreeCard(cars, tick) {
    return cars.filter(car => car.tick < tick)
}

function ticksToStartPosition(car, route) {
    let carX = car.x;
    let carY = car.y;
    let routeX = route.a;
    let routeY = route.b;
    return Math.abs(carX - routeX) + Math.abs(carY - routeY);
}

function ticksForDoingRoute(route) {
    return Math.abs(route.a - route.x) + Math.abs(route.b - route.y);
}

function shouldDoRoute(car, route, tick) {
    let ticksToStartPosition_ = ticksToStartPosition(car, route);
    let ticksForDoingRoute_ = ticksForDoingRoute(route);
    return Math.abs(tick - route.f) > Math.abs(ticksToStartPosition_ + ticksForDoingRoute_);
}

function remove(array, item) {
    // Copy the array
    array = [...array];

    // Look for the item (the item can have multiple indices)
    let fromIndex = array.length - 1;
    let foundIndex = array.lastIndexOf(item, fromIndex);

    while (foundIndex !== -1) {
        // Remove the item by generating a new array without it
        array = [
            ...array.slice(0, foundIndex),
            ...array.slice(foundIndex + 1),
        ];

        // Bookkeeping
        fromIndex = foundIndex - 1;
        foundIndex = array.lastIndexOf(item, fromIndex)
    }

    // Return the new array
    return array;
}